(function($) {
$(document).ready(function(){

	$(".bx-slider").find("ul").bxSlider({
		auto:true,
		controls:false,
		pager:false,
		speed:1000,
		pause: 5000,
		useCSS: false
	});

	$('#recent-carousel').find("ul").bxSlider({
		minSlides: 3,
		maxSlides: 3,
		slideWidth: 292,
		slideMargin: 32,
		pager: false,
		moveSlides: 1,
		nextSelector: '#recent-next',
  		prevSelector: '#recent-prev'
	});

	$('#designers-carousel').find("ul").bxSlider({
		minSlides: 3,
		maxSlides: 3,
		slideWidth: 270,
		slideMargin: 50,
		pager: false,
		moveSlides: 1,
		nextSelector: '#designer-next',
  		prevSelector: '#designer-prev'
	});

	$('#customers-carousel').find("ul").bxSlider({
		minSlides: 3,
		maxSlides: 3,
		slideWidth: 270,
		slideMargin: 50,
		pager: false,
		moveSlides: 1,
		nextSelector: '#customer-next',
  		prevSelector: '#customer-prev'
	});

	$('.filter-input-box').jScrollPane();

	$( "#price-range" ).slider({
      range: true,
      min: 0,
      max: 10000,
      values: [ 0, 10000 ],
      slide: function( event, ui ) {
        $( "#price-min" ).val( "" + ui.values[ 0 ] );
        $( "#price-max" ).val( "" + ui.values[ 1 ] );
      }
    });
    $( "#price-min" ).val( "" + $( "#price-range" ).slider( "values", 0 ) );
    $( "#price-max" ).val( "" + $( "#price-range" ).slider( "values", 1 ) );
	
	$(".item-title").on("click",function(e){
    	e.preventDefault();
    	$(this).toggleClass("close").closest(".filter-item").find(".filter-input-box, .color-wrap, .price-range-box, .section-in-shop-wrap").slideToggle();
    });
	
	$(".product-shipping-info > a").on("click",function(e){
    	e.preventDefault();
    	$(this).toggleClass("close").closest(".product-shipping-info").find("p").slideToggle();
    });

    $(".shop-item-img").on("mouseover",function(){
    	$(this).closest(".shop-item").find(".share-links").fadeIn();
    });
    $(".shop-item-img").on("mouseleave",function(){
    	$(this).closest(".shop-item").find(".share-links").fadeOut();
    });

    $('#login, #join-now-link, #sign-in-link').fancybox({
    	wrapCSS:"sign-in-modal"
	});

	$('.zoom-img').fancybox({
		closeBtn:false
	});

    $(".fb-tab").on("mouseover",function(){
    	$(this).animate({
    		right: "0"
    	}, 200, function(){});
    }).on("mouseleave",function(){
    	$(this).animate({
    		right: "-81px"
    	}, 200, function(){});
    });

    $(".faq-box ul li a").on("click", function(e){
    	e.preventDefault();
    	$(this).toggleClass("current").parent().find("p").slideToggle();
    });

    $(".designer-page-tabs, .product-page-tabs").tabs();

    $("#product-gallery").bxSlider({
    	mode:'fade',
    	pagerCustom: '#product-gallery-thumb',
    	controls: false
	});

	$("#product-gallery-thumb").find("a").on("click", function(){
		var fullImgHref = $(this).data("img-href");
		$("#zoom-img-modal").find("img").attr("src",fullImgHref);
	});
	
});
})(jQuery);	

(function($) {
$(window).load(function() {

});
})(jQuery);	